import React from 'react'
import appIcon from "../../images/application-icon.png";
import blockChainIcon from "../../images/blockchain-black.png";
import "./IntroImage.styles.scss";
import {Container} from 'react-bootstrap';
import Button from "react-bootstrap/Button";

const IntroImage = () => {
  return (
    <>
      <Container>
        <h1>React-Bootstrap Container</h1>
        <Button variant="primary">Primary</Button>
        <Button variant="outline-primary">Primary</Button>{" "}
        <i class="bi-alarm" style="font-size: 2rem; color: cornflowerblue;"></i>
      </Container>
      <div className="backgroundImgDiv">
        <h1>I'm Daniel...</h1>
        <img
          src={blockChainIcon}
          alt="blockchain icon"
          className="blockchain-top"
        />
        <img src={appIcon} alt="application icon" className="app-img" />
        <h2>...a blockchain and web app developer!</h2>
        <img
          src={blockChainIcon}
          alt="blockchain icon"
          className="blockchain-bottom"
        />
      </div>
    </>
  );
}

export default IntroImage
